import React from "react";
import { Link } from "react-router-dom";

function HeaderMain() {
  return (
    <header>
      <div className="content">
        <div>
          <h1>CRUDer</h1>
        </div>
        <div className="btn-new-Post">
          <Link to="/post"></Link>
          <button>Add New Post</button>
        </div>
      </div>
    </header>
  );
}

export default HeaderMain;
